function Quizz() {
  return (
    <div className="quizz">
      <div className="question"> which one is part of CPU?</div>
      <div className="answers">
        <div className="answer">ALU</div>
        <div className="answer">AU</div>
        <div className="answer">Register</div>
        <div className="answer">All</div>
      </div>
    </div>
  );
}
